// returns a random number between min (included) and max (excluded)
function getRndInteger(min, max) {
  return Math.floor(Math.random() * (max - min)) + min;
}

function initProduct(factory, productId, productName, productType, pricePerUnit, amount, imageBase64Encode, description, cartStatus, productStatus, ownerId, ownerImage){
  var pro = factory.newResource(NS, 'Product', productId);
  pro.productType = productType;
  pro.productName = productName;
  pro.pricePerUnit = pricePerUnit;
  pro.amount = amount;
  pro.imageBase64Encode = imageBase64Encode;
  pro.description = description;
  pro.cartStatus = cartStatus;
  pro.productStatus = productStatus;
  pro.owner = factory.newRelationship(NS, 'Collector', ownerId);
  pro.ownerImage = ownerImage;

  return pro;
}